import React from 'react';
import { YOUTUBEURL,PLAYLISTSITEMS, apiKey } from './apis';
import { playlists } from './Playlist';

const playlistItems = async () => {
    console.log("playlistItem")
    console.log(playlists());
    const json = await (
        await fetch(
            `${YOUTUBEURL}${PLAYLISTSITEMS}?key=${apiKey}&playlistId=${playlists(0)}&part=id,snippet`
        )
    ).json();
    console.log("playlistItems");
    console.log(json);
    return json.items[0].snippet.resourceId.videoId;
};

export {playlistItems};
